import React,{useState,useEffect, useCallback} from 'react'


const Home=()=>{
    const [data,setData]=useState([])
    useEffect(()=>{
        fetch('/allpost',{
            headers:{
                "Authorization":"Bearer "+localStorage.getItem("jwt")
            }
        })
        .then(res=>res.json())
       .then(result=>{
           console.log(result)
           setData(result.posts)
       })
    },[])
    return(
        <div className="home">
            <div className="card home-card">
                <h5>Aditi</h5>
                <div className="card-image">
                    <img src="https://images.unsplash.com/photo-1517685352821-92cf88aee5a5?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=967&q=80"></img>
                </div>
                <div className="class-content">
                    <i className="material-icons">favorite</i>
                    <h6>title</h6>
                    <p>its a post</p>
                    <input type="text" placeholder="add a comment"></input>
                </div>
            </div>
        </div>
    )
}

export default Home
